(2, 3, 'dont-pay-big-city-prices', 'Prio Kus Nugroho', 'Don\'t pay big city prices', '<p>    <a href=\"https://mamakriau.com/\">mamakriau.com</a> - A creative agency can be a powerful partner if your brand needs help improving its marketing operation. From content and KPIs to editorial planning and design, they can help supplement your efforts, guide your strategy, or help you set up your own infrastructure. But finding the right partner isn’t always easy. </p>\r\n\r\n<p>    There are plenty of creative agencies out there, so how do you choose the one that will work for you? To help you figure it out, we’re sharing our best tips to find and vet an agency that will really help your brand. </p>\r\n\r\n<div><strong>All  </strong><strong>Tips to Find the Right Creative Agency</strong></div>\r\n\r\n<p>    Having worked with hundreds of brands over the last decade, we know what roadblocks and hiccups can befall a brand on the hunt for a good agency. Here’s how to ensure the road to the right partner is as smooth as possible. </p>\r\n\r\n<div><strong>1) Know what you’re trying to achieve. </strong></div>\r\n\r\n<p>    You don’t have to know exactly what creative idea you want to bring to life (that’s often why you’re seeking a creative agency in the first place), but you do need to know your goals before you hire one. The clearer your objectives, the easier it will be for your agency to find a creative solution. </p>\r\n\r\n<p>    Of course, if you’re soliciting an agency to guide your strategy because you’re unsure what to do, that’s OK. You don’t want to approach an agency with absolutely no idea what you need. </p>\r\n\r\n<div><strong>2) Look for someone in your industry. </strong></div>\r\n\r\n<p><strong>    </strong>There are a lot of creative agencies out there, which is why finding one can be intimidating. Luckily, some agencies specialize in particular industries, such as B2B tech. With their intimate knowledge of the landscape, they are well equipped to help you achieve your goals. If you’re not sure where to start, ask your colleagues and friends for recommendations. Otherwise, Google around. </p>\r\n\r\n<p>Note: While a local agency is convenient, you might find a better fit in one outside your immediate area. Thanks to the power of tech, collaboration isn’t as challenging as it once was, so don’t let that impede you. </p>\r\n\r\n<div><strong>3) Look for demonstrated results. </strong></div>\r\n\r\n<p><strong>    </strong>Any agency worth its salt will have a healthy portfolio of work and case studies that showcase its results. As you review their work (and client list), you’ll get a sense of their style, skill, and creative approach.</p>\r\n\r\n<p>    Ideally, they’ve worked with people in your industry or executed the type of campaign you’re looking for. However, if you don’t see what you’re looking for but do like their vibe, reach out to ask for additional examples. </p>\r\n\r\n<div><strong>4) Find out if they share their expertise. </strong></div>\r\n\r\n<p><strong>    </strong>A good agency is invested in elevating its industry. Thus, they should demonstrate their expertise in other ways, such as blogs, articles, books, contributorships, or features in industry publications. </p>\r\n\r\n<p>    This willingness to share their expertise—and be an active participant in their field—is always a good indicator that they are knowledgeable and confident in their work. </p>\r\n\r\n<div><strong>5) Look at their own content. </strong></div>\r\n\r\n<p><strong>    </strong>Consider how they present themselves through their own content. Review their site and social presence to get a sense of their personality, team members, and values. You want to work with people you click with naturally, but you also want to make sure you’re working with people who practice what they preach. </p>\r\n\r\n<p>Note: If your research doesn’t give you a sense of who they are, that’s a tip-off right there. </p>\r\n\r\n<div><strong>6)</strong> <strong>Interview at least 3 agencies.</strong> </div>\r\n\r\n<p>    No matter how good someone’s work is in their portfolio, one of the biggest factors influencing your success is how well you work together. So take the time to research and talk to potential candidates. You might be in love with one’s illustration style but not jive with their creative approach. Or you might be wowed by their work <em>and</em> their values. You won’t know until you talk to them. This brings us to another point: the interview. </p>\r\n\r\n<p><img alt=\"\" src=\"https://mamakriau.com/images/gallery/interview-20210223210045.jpg\"></p>\r\n\r\n<div><strong>What To Ask Your Creative Agency In Your Interview</strong></div>\r\n\r\n<p>    Whether this is your first time working with an agency or not, it’s always worthwhile to ask direct questions that will give you a sense of who they are and how they work. A few tips to make the vetting process more effective:</p>\r\n\r\n<ul>\r\n <li>\r\n <p><strong>Craft your questions in advance. </strong>This isn’t about conducting a prim and proper interview. It can be casual and exploratory, but you want a framework to guide your conversation. Note: You also don’t want to forget to ask anything important. It would be best if you also asked unexpected questions. This will allow you to get past the practiced and memorized answers you might typically get.</p>\r\n </li>\r\n <li>\r\n <p><strong>Speak in everyday language. </strong>Do what you can to make sure you and the agency rep are speaking the same language. Avoid too many insider industry terms, and clarify what you mean when using broad terms like “campaign” or “strategy.” This will help everyone avoid misconceptions.</p>\r\n </li>\r\n <li>\r\n <p><strong>Make sure they’re interviewing you too.</strong> Again, you want to cultivate a positive relationship, so your agency should be interested, engaged, and asking you questions as well. (Agencies that care about working with partners who are the right fit will probably be a better fit.)</p>\r\n </li>\r\n</ul>\r\n\r\n<p>If you’re not sure what to ask, here are a few standard questions that should get the ball rolling:</p>\r\n\r\n<ul>\r\n <li><strong>How much experience do you have in my industry?</strong></li>\r\n <li><strong>Do you have the resources to take on my project?</strong></li>\r\n <li><strong>What is your timeline for projects similar to mine?</strong></li>\r\n <li><strong>Who will I be working with? </strong></li>\r\n <li><strong>What does your creative process look like?</strong></li>\r\n <li><strong>How much work is produced by your staff (vs. outsourced)?</strong></li>\r\n <li><strong>Can you provide itemized pricing?</strong> </li>\r\n <li>\r\n <p>(Transparency is important here, as scope creep can be a huge problem. You want to know exactly what you’ll be paying for. If they can’t provide that, move on.)  </p>\r\n </li>\r\n</ul>\r\n\r\n<p>(You can also ask our <a href=\"https://mamakriau.com/contact\">contact</a> for more question prompts.)</p>\r\n\r\n<p>    Throughout the process, go with your gut. You want to work with an agency that is friendly, responsive, and eager to build a long-term relationship with you. If you aren’t feeling those vibes from the jump, look for one that does make you feel that way. </p>\r\n\r\n<div><strong>What to Do Once You Find the Right Partner</strong></div>\r\n\r\n<p>    A good relationship is a true partnership, which means you’re both responsible for showing up and doing your part. Luckily, there are a few things you can do to start on the right foot:  </p>\r\n\r\n<ul>\r\n <li>Follow these tips to build a strong relationship with your agency from the jump. </li>\r\n <li>Try these tactics to work together more effectively. </li>\r\n <li>Decide how you’ll split the workload up front. </li>\r\n</ul>\r\n\r\n<p>    And if you’re curious to learn more about how we work, <a href=\"https://mamakriau.com/contact\">hit us up</a>. We’re always happy to talk shop. </p>\r\n\r\n<p> </p>\r\n', 'don\'t-pay-big-city-prices', 'dont-pay-big-city-prices-20210226004047.jpg'),
(3, 2, 'build-a-great-brand-identity', 'Prio Kus Nugroho', 'How to build a great brand identity', '<p>    <a href=\"https://mamakriau.com/\">mamakriau.com</a> - A strong brand identity doesn’t happen overnight. You can’t just pick a few colors and slap together a logo. You need to approach your design strategically. This requires deep thinking, a team with strong communication and design skills, and an intimate understanding of your brand.</p>\r\n\r\n<p>The good news is that while this may seem intimidating, it doesn’t have to be. With the right guidance, you can move through the process effectively and produce a truly great brand identity. Luckily, we can provide that guidance.</p>\r\n\r\n<p>Here, you’ll learn everything you need to know about designing a brand identity, along with our best tips and tools to do it. </p>\r\n\r\n<p> </p>\r\n\r\n<div><strong>Table of Contents</strong></div>\r\n\r\n<ul>\r\n <li><a href=\"https://mamakriau.com/project/category/strategic-brand-solution\"><strong>What Is Brand Identity?</strong></a></li>\r\n <li><strong>What Does a Brand Identity Include?</strong></li>\r\n <li><strong>The Keys to a Strong Brand Identity </strong></li>\r\n <li><strong>How to Build a Brand Identity</strong>\r\n <ul>\r\n  <li><strong>Complete Your Brand Strategy</strong></li>\r\n  <li><strong>Dig Into Your Current Brand Identity</strong></li>\r\n  <li><strong>Know Your Personas</strong></li>\r\n  <li><strong>Identify Your Competition</strong></li>\r\n  <li><strong>Write Your Creative Brief</strong></li>\r\n  <li><strong>Brainstorm Your Visuals</strong></li>\r\n  <li><strong>Design Your Individual Elements</strong></li>\r\n </ul>\r\n </li>\r\n <li><strong>Build Your Brand Style Guide</strong></li>\r\n <li><strong>How to Keep Your Brand Identity Strong</strong></li>\r\n</ul>\r\n\r\n<hr>\r\n<div><strong>What Is Brand Identity?</strong></div>\r\n\r\n<p>Is it your logo? Your color palette? Your infographic style? It’s all that—and more.</p>\r\n\r\n<p>Branding pro-Marty Neumeier defines brand identity as “the outward expression of a brand, including its trademark, name, communications, and visual appearance.” To us, a brand identity is a total of how your brand looks, feels, and speaks to people. (Sometimes that even includes how it sounds, tastes, feels, and even smells.)</p>\r\n\r\n<p>Ultimately, a brand identity is a way to communicate with the world, differentiate yourself from your competition, and create a brand experience that encourages people to engage with you.</p>\r\n\r\n<p>Some brands elevate brand identity to an art (think <a href=\"http://www.apple.com/\">Apple</a>, <a href=\"http://www.lego.com/\">LEGO</a>, or <a href=\"http://www.levi.com/\">Levi’s</a>). Some brands make it their entry into the playing field (think <a href=\"https://www.warbyparker.com/\">Warby Parker</a> or <a href=\"https://casper.com/\">Casper</a>). Unfortunately, some (okay, many) brands struggle because they don’t know who they are or don’t know how to communicate effectively. (Not sure if your current brand identity works for you? Here is your <a href=\"https://mamakriau.com/project/category/strategic-brand-solution\">brand identity design</a>.)</p>\r\n\r\n<p>Regardless of where you fall on that spectrum, one thing is sure. If you want to be a competitive and successful company, crafting a strong brand identity is mandatory. When you can successfully communicate who you are, you can better communicate with people and form the strong relationships you need for long-term success. </p>\r\n\r\n<div><strong>What Does a Brand Identity Include?</strong></div>\r\n\r\n<p>A logo and a color palette alone do not make a brand identity. When designing your identity, you need to create a comprehensive visual language applied to everything from your website to your packaging. Depending on your brand (and the type of content you plan to create), your needs may be more expansive, but a basic brand identity includes:</p>\r\n\r\n<ul>\r\n <li>Logo</li>\r\n <li>Colors</li>\r\n <li>Typography</li>\r\n <li>Design System</li>\r\n <li>Photography</li>\r\n <li>Illustration</li>\r\n <li>Iconography</li>\r\n <li>Data visualization</li>\r\n <li>Interactive elements</li>\r\n <li>Video and motion</li>\r\n <li>Web design</li>\r\n</ul>\r\n\r\n<p>Remember: Your brand identity should translate across mediums, including everything you need to make sure it does. </p>\r\n\r\n<div><strong>The Keys to a Strong Brand Identity </strong></div>\r\n\r\n<p>That said, just because you design those elements doesn’t mean they’re effective. Strong brand identity must work for everyone, both your internal team (e.g., brand ambassadors, content creators) and the people who will interact with it (e.g., customers). As you embark on the design process, make sure your brand identity is:</p>\r\n\r\n<ul>\r\n <li><strong>Distinct: </strong>It stands out among competitors and catches people’s attention.</li>\r\n <li><strong>Memorable: </strong>It makes a visual impact. (Consider Apple: The logo is so memorable they only include the logo—not their name—on their products.)</li>\r\n <li><strong>Scalable and flexible: </strong>It can grow and evolve with the brand.</li>\r\n <li><strong>Cohesive: </strong>Each piece complements the brand identity.</li>\r\n <li><strong>Easy to apply: </strong>It’s intuitive and clear for designers to use.</li>\r\n</ul>\r\n\r\n<p>If any of these elements are missing, it will be challenging for your brand team to do their job well.</p>\r\n\r\n<div><strong>How to Build a Brand Identity</strong></div>\r\n\r\n<p>To demystify the process for you, we’ve crafted this step-by-step guide to building a brand identity. The process can seem intimidating, but we’ve been through it many times with our creative partners (and through our own rebranding), so we know firsthand what mistakes to avoid and how to make it easier on everyone.</p>\r\n\r\n<p>If your brand is in its early stages of preparing to rebrand and not sure where to start, follow these tips to move through the process seamlessly and build a stronger brand identity that sets you up for success. </p>\r\n\r\n<p> </p>\r\n\r\n<div><strong>STEP 1: Complete Your Brand Strategy</strong></div>\r\n\r\n<p>Your brand strategy is a detailed plan that outlines exactly what you’re trying to achieve and how you’re going to achieve it. It is comprised of your:</p>\r\n\r\n<ul>\r\n <li>Brand Heart (purpose, vision, mission, values)</li>\r\n <li>Brand Messaging (brand voice, personality, tagline, value prop, brand messaging pillars)</li>\r\n <li>Brand Identity (logo, color, typography, etc.)</li>\r\n</ul>\r\n\r\n<p>Your brand identity is really a tool to help you communicate your brand visually, thus supporting your brand strategy. As such, before you dive into your brand identity, it’s important to have a fully fleshed-out strategy. </p>\r\n\r\n<div><strong>HOW TO DO IT</strong></div>\r\n\r\n<p>To design a strong brand identity, you need to complete the foundational work of your brand strategy, specifically your Brand Heart and Brand Messaging. These help you understand what it is you’re trying to communicate so that you can design a brand identity that successfully does so. </p>\r\n\r\n<p>If you don’t have your brand strategy documented (or have never gone through the exercise), follow our stress-free guide to creating a brand strategy, and download our free Brand Strategy Toolkit below.</p>\r\n\r\n<p> </p>\r\n\r\n<p>Once you’ve documented your brand strategy—and received approval from leadership—you can focus on brand identity.</p>\r\n\r\n<p> </p>\r\n\r\n<div><strong>STEP 2: Dig Into Your Current Brand Identity</strong></div>\r\n\r\n<p>When you begin a branding project, you want to approach each phase from a philosophical and highly critical standpoint—inspect, poke, and prod until you get to the core of your brand. </p>\r\n\r\n<p>Whether you’re building your brand identity entirely from scratch or updating a stale identity, you need a full assessment of:</p>\r\n\r\n<ul>\r\n <li>The current state of your brand’s identity</li>\r\n <li>How that brand identity might be crafted or tweaked to align with your goals going forward</li>\r\n</ul>\r\n\r\n<p>The goal is to understand how your brand is perceived, both internally and externally. Getting an honest and accurate reflection is the only way to understand how and where you’re succeeding or how you need to course correct. </p>\r\n\r\n<div><strong>HOW TO DO IT</strong></div>\r\n\r\n<p>Start with our brand identity design survey. This survey is a deep dive into every aspect of your brand, from your values and personality to logo and positioning. Distribute the questionnaire to your internal team. You may also need the perspective of:</p>\r\n\r\n<ul>\r\n <li>Brand Employees</li>\r\n <li>Stakeholders</li>\r\n <li>Customers</li>\r\n</ul>\r\n\r\n<p>While completing this questionnaire may be laborious, it’s crucial to build the foundation upon which your visual language will stand.</p>\r\n\r\n<p><em>Example: Brand audit responses provide valuable insight for our designers.</em></p>\r\n\r\n<p> </p>\r\n\r\n<div><strong>STEP 3: Know Your Personas</strong></div>\r\n\r\n<p>Your brand identity is the “face” that interacts with the entire world. Whatever you create should accurately communicate who you are. However, one common misconception is that a brand identity is exclusively informed by what your brand wants to present. This isn’t entirely true. It’s also informed by what your brand’s customers want to engage with or are accustomed to interacting with. If your identity doesn’t resonate with them, it won’t be effective.<br>\r\nThis doesn’t necessarily mean your brand’s customers will choose your logo color; it means that you will make more effective design choices once you understand their needs, wants, and values.</p>\r\n\r\n<div><strong>HOW TO DO IT</strong></div>\r\n\r\n<p>To understand who you’re trying to reach, try this easy exercise to create personas representing your different target segments. These personas identify demographic and psychographic information that gives you insight into who these people are and what drives them.</p>\r\n\r\n<p>Beyond your primary audience (customers), you also want to consider how secondary or tertiary groups might perceive your brand (e.g., other brands or potential employees). This information can also influence your design decisions.</p>\r\n\r\n<p> </p>\r\n\r\n<div><strong>STEP 4: Identify Your Competition</strong></div>\r\n\r\n<p>Building a brand identity is all about differentiation: making your brand visible, relevant, and unique. However, without a firm understanding of your competitive landscape, it’s easy to blend in. Thus, it’s crucial to understand not just who your competition is but how your brand compares in perception and presentation.  </p>\r\n\r\n<div><strong>HOW TO DO IT</strong></div>\r\n\r\n<p>To get a snapshot of the competition, follow our guide to complete a competitive analysis. As you move through the process, please pay special attention to how your competitors present themselves in terms of common visual elements, trends, industry-specific visual themes, brand personalities, etc.</p>\r\n\r\n<p>For example, we once did competitive research for a brand and found that all of their competitors used the same four colors. This isn’t uncommon, as many industries tend to gravitate toward the same visual elements (think Netflix and YouTube’s red color), but it revealed a great opportunity to differentiate.<br>\r\n </p>\r\n\r\n<p>One notable example of this: In 2011, video platform Twitch made a splash with their all-purple branding, at a time when their competitors used bold greens and reds. The color instantly became a hallmark of their brand. (BTW, the company was so successful it sold to Amazon for a cool <a href=\"https://techcrunch.com/2014/08/25/amazon-will-buy-twitch-for-over-1-billion/\">$1 billion</a> in 2014.)</p>\r\n\r\n<p> </p>\r\n\r\n<div><strong>STEP 5: Write Your Creative Brief</strong></div>\r\n\r\n<p>Once you’ve completed the previous steps, you have the information you need to start design. However, it would be best if you didn’t jump right in. Start with a creative brief that details the pertinent info you need to keep your team on the same page—and ensure you create a visual identity that aligns with your brand.  </p>\r\n\r\n<div><strong>HOW TO DO IT</strong></div>\r\n\r\n<p>Use our creative brief template. Note: Don’t provide too much or too little info. Your brief should always inform, not overwhelm. </p>\r\n\r\n<p> </p>\r\n\r\n<div><strong>STEP 6: Brainstorm Your Visuals</strong></div>\r\n\r\n<p>By this time, you have a ton of information to help inform ideation, between your competitive analysis, brand audit, personas, and brief. At this stage, you want to take that text-based information and translate it into visual concepts.</p>\r\n\r\n<p>Luckily, the information you have is often steeped in emotional language about your brand’s personality, goals, and values. Now the challenge is to figure out how to communicate and enhance those sentiments through visuals.<br>\r\n </p>\r\n\r\n<div><strong>HOW TO DO IT</strong></div>\r\n\r\n<p>To start, have your team brainstorm word clouds that describe your brand. (Or you can come in with 5-7 descriptors to start.) The focus is not to free-associate words into other words. The goal is to bring those words to life through visuals.</p>\r\n\r\n<p>Think about what those words make you visualize. The associations may be abstract, but it is important to get everything out. For example, if your brand service is “fast,” don’t talk about other words for “fast” (e.g., “swift”). Think about what fast brings to mind.</p>\r\n\r\n<div><strong>FAST > CHEETAH > LIGHTNING BOLT > ZEUS</strong></div>\r\n\r\n<p>Think about what concepts you can visualize. Pro tip: It’s usually the elements that elicit the strongest emotional response, trigger additional imagery, and help you build a visual playground to go nuts in.<br>\r\n </p>\r\n\r\n<p><em>Example: Our team at work for the ESPEN (Expanded Special Project For Elimination of Neglected Tropical Diseases) brand identity, a Bill & Melinda Gates Foundation project. After brainstorming, our design team began to sketch every visual idea that came to them quickly. These ideas helped form the foundation of the brand identity. </em></p>\r\n\r\n<p> </p>\r\n\r\n<div><strong>STEP 7: Design Your Individual Elements</strong></div>\r\n\r\n<p>Here comes the fun (and challenging) part. You want to design each element in the order dictated here, as each element influences the other.</p>\r\n\r\n<p><strong>Logo</strong></p>\r\n\r\n<p>A brand identity is an intricate design system. Each element influences the other, but it starts with your logo.</p>\r\n\r\n<div><strong>HOW TO DO IT</strong></div>\r\n\r\n<p>You can go old-school here and bust out the pencils to free-sketch. As you go through iterations, flesh out logo marks, core shapes, and complementary imagery—all in black and white. As you receive feedback and iterate, you want to make sure that the core imagery is powerful enough to deliver the message independently, without the enhancement of color. For more tips on logo design, check out our <a href=\"https://mamakriau.com/project/category/graphic-design-project\">guide to designing a logo you love</a>.<br>\r\n </p>\r\n\r\n<p><em>Example: You can see many iterations of our logo for UCI Applied Innovation, from the most basic black-and-white sketch to fully rendered images.</em></p>\r\n\r\n<p><em>And the final result:</em></p>\r\n\r\n<p> </p>\r\n\r\n<p><strong>Colors</strong></p>\r\n\r\n<p>Once you have a solid logo, you can explore your color palette. Color is a great tool to differentiate your brand from competitors, but know that color can also elicit strong emotions, so choose wisely. </p>\r\n\r\n<div><strong>HOW TO DO IT</strong></div>\r\n\r\n<p>A good color palette is clean and flexible, supplying designers with enough choices to be creative but not enough to overwhelm. This includes:</p>\r\n\r\n<ul>\r\n <li>1 main color</li>\r\n <li>2 primary colors</li>\r\n <li>3-5 complementary colors</li>\r\n <li>2 accent colors</li>\r\n</ul>\r\n\r\n<p>For more tips, see our guide to choosing the right colors for your brand identity.</p>\r\n\r\n<p><em>Example: Color guidelines from the Visage brand identity help the team create various colors and, most importantly, on-brand content. </em></p>\r\n\r\n<p> </p>\r\n\r\n<div><strong>Typography</strong></div>\r\n\r\n<p>Every visual element in your identity should contribute to a cohesive visual language, and thus each should complement the other. This is particularly true of typography, in which the shape should inform of your logo. </p>\r\n\r\n<div><strong>HOW TO DO IT</strong></div>\r\n\r\n<p>Every stage has its own unique challenges, but typography can be tricky in a visual language, especially when brands follow trends (serif vs. non-serif) that are hot for a second but quickly become dated or appear unoriginal.</p>\r\n\r\n<p>To keep it simple, limit the number of font families to 2-3. This generally includes primary and secondary brand typefaces for specific purposes, such as body copy typeface, UI typeface, etc. For a deeper dive into choosing typography (including whether or not to license fonts), see our guide to choosing the best typography for your brand.</p>\r\n\r\n<p><em>Example: Guidelines from the Visage brand identity dictate how typography should be used. </em></p>\r\n\r\n<p> </p>\r\n\r\n<div><strong>Design System</strong></div>\r\n\r\n<p>This is often a weak point in visual languages. Brands think that they can combine them however they like because they have their logo, color, and typography set.</p>\r\n\r\n<p>But because brand identity is all about introducing yourself to people effectively, it’s important to make it an enjoyable experience. In information design, that means providing a truly consistent and cohesive presentation.</p>\r\n\r\n<div><strong>HOW TO DO IT</strong></div>\r\n\r\n<p>The goal is to design an intuitive hierarchy and layout that makes it easy to navigate visual communication. Consider the proper content order, including headers, subheaders, body copy, images, blurbs, etc. For more tips, see the Interaction Design Foundation’s guide to visual hierarchy. </p>\r\n\r\n<p><em>Example: The hierarchy guidelines from the Avalere Health brand identity include detailed real-world examples of proper layout. </em></p>\r\n\r\n<p> </p>\r\n\r\n<div><strong>Photography</strong></div>\r\n\r\n<p>Photography plays a huge role in your brand identity, from your product images to your advertising. It’s important to identify clear guidelines about the types of images (and visual treatments) that are and aren’t appropriate.</p>\r\n\r\n<div><strong>HOW TO DO IT</strong></div>\r\n\r\n<p>To learn more about the role of images in storytelling, see Fabrik Brand’s guide to brand photography.</p>\r\n\r\n<p><em>Example: The photo guidelines from the Visage brand identity include detailed instructions on the use of filters and typography as well. </em> </p>\r\n\r\n<p> </p>\r\n\r\n<div><strong>Illustration</strong></div>\r\n\r\n<p>When it comes to illustration, you need a cohesive and uniform language. Don’t over-illustrate or use clashing styles. Instead, think of how your illustration will be used in conjunction with other visual elements.</p>\r\n\r\n<div><strong>HOW TO DO IT</strong></div>\r\n\r\n<p>To figure out how to illustrate your brand, follow <em>Smashing Magazine</em>‘s tips for drawing a strong visual identity.</p>\r\n\r\n<p> </p>\r\n\r\n<div><strong>Iconography</strong></div>\r\n\r\n<p>Good iconography is influenced not just by the creative visual language but by the applications for the work. It depends on your product or service and the industry and medium (e.g., web-only vs. UI vs. sales brochures).</p>\r\n\r\n<div><strong>HOW TO DO IT</strong></div>\r\n\r\n<p>Iconography is part art, part science, so you want to make sure things are as clear as possible. For more tips, see Design Systems’ complete guide to iconography.</p>\r\n\r\n<p><em>Example: Iconography guidelines from the Avalere Health brand identity. </em></p>\r\n\r\n<p> </p>\r\n\r\n<div><strong>Data Visualization</strong></div>\r\n\r\n<p>Data should be designed for clarity and comprehension, in addition to aesthetic appeal. Thus, it’s important to design visualizations that adhere to data visualization best practices.</p>\r\n\r\n<div><strong>HOW TO DO IT</strong></div>\r\n\r\n<p>If you’re not familiar with designing data, find out how to design the most common charts and graphs with our Data Visualization 101 guide, and check out these 25 tips to improve your data visualizations. </p>\r\n\r\n<p> </p>\r\n\r\n<div><strong>Additional Elements</strong></div>\r\n\r\n<p>Again, your brand may have unique communication needs, depending on your industry, content, etc. Make sure that your brand identity includes these elements, such as:</p>\r\n\r\n<ul>\r\n <li>Interactive elements</li>\r\n <li>Motion graphics</li>\r\n <li>Video</li>\r\n <li>Web design</li>\r\n</ul>\r\n\r\n<p>For more tips, check out our checklist of everything to include in your <a href=\"https://mamakriau.com/project/category/web-app-development\">visual identity.</a></p>\r\n\r\n<p> </p>\r\n\r\n<div><strong>STEP 8: Build Your Brand Style Guide</strong></div>\r\n\r\n<p>The only thing more heartbreaking than a poorly designed brand identity is a beautifully designed identity that is never used or misused. A brand style guide is a savior here—if it’s crafted the right way.</p>\r\n\r\n<div><strong>HOW TO DO IT</strong></div>\r\n\r\n<p>Include clear, easy-to-follow guidelines for every part of the brand identity, including examples and use-cases. Also include practical detail, denoting as much information as needed to successfully help your designer replicate the brand identity. For more direction, follow our guide to creating a <a href=\"https://mamakriau.com/project/category/web-app-development\">brand style guide</a> people will actually use.</p>\r\n\r\n<p>Once completed, make sure guidelines are distributed to the team, stored in an easy-to-access place, and regularly updated.</p>\r\n\r\n<p><em>Example: The Avalere Health style guide includes a handy TOC to access the desired info easily. </em></p>\r\n\r\n<p> </p>\r\n\r\n<div><strong>How to Keep Your Brand Identity Strong</strong></div>\r\n\r\n<p>Designing a successful brand identity takes a lot of work and collaboration. To keep your team on the same page and empower them to do the best job possible, make sure they are:</p>\r\n\r\n<ul>\r\n <li>\r\n <div><strong>Educated: </strong>Find out what brand identity mistakes to avoid at every stage. </div>\r\n </li>\r\n <li>\r\n <div><strong>Inspired: </strong>Check out these <a href=\"https://mamakriau.com/project/category/web-app-development\">examples of brands with an awesome visual identity</a>.</div>\r\n </li>\r\n <li>\r\n <div><strong>Equipped:</strong> Bookmark these 75 tips, tools, and resources to help your team create a great brand identity and determine how to make sure all your content is on-brand going forward. </div>\r\n </li>\r\n</ul>\r\n\r\n<p>And if you’re feeling overwhelmed or don’t have the resources to take on the project yourself, consider bringing in some expert help. Follow our tips to find the right creative agency for you or <a href=\"https://mamakriau.com/contact\">mail</a> us. We’re happy to help you get your brand on the right track. </p>\r\n\r\n<p> </p>\r\n', 'how-to-build', 'how-to-build-a-great-brand-identity-20210226004213.jpg'),
(4, 3, 'brand-immersion-value-in-marketing', 'Prio Kus Nugroho', 'Brand Immersion Value in Marketing Strategy', '<p>    <a href=\"https://mamakriau.com/\">mamakriau.com</a> - <strong><em>\"Now people are not buying the same way they were a few years ago.\"  </em></strong></p>\r\n\r\n<p>    The traditional marketing strategy nowadays barely works anymore. Not because of the nature of its advertising, but now more and more people are looking for, comparing different brands, reading product reviews to update, and then learning something about <em>the brand </em>online.   </p>\r\n\r\n<p>    So you have to think of a marketing strategy so that you can attract them to your business, make friends with them, convert customers, and finally, they happily become promoters of your <em>brand</em>. One of them is <em>brand immersion </em>marketing. You build a <em>brand </em>and use it to get both sales and customers. Your <em>brand </em>is central to the methodology.  </p>\r\n\r\n<div> <strong>How can?</strong></div>\r\n\r\n<div> </div>\r\n\r\n<div><strong>   1. Know the Immersion Brand Marketing Methodology First</strong></div>\r\n\r\n<p>    In this marketing system, the focus is on how to create a strong <em>brand </em>image. One of the ways is to provide educational content to be useful so that people feel interested and then learn more about what you sell on your website.  </p>\r\n\r\n<p>    You no longer need to advertise, buy email lists, or call with cold responses with this strategy. People are tired of always being the storyteller; nowadays, people want to be the narrator more. Also, they want to feel close to your <em>brand </em>to have a story from your <em>brand</em>.    </p>\r\n\r\n<div>    <strong>2. Brand Immersion Marketing Strategy</strong></div>\r\n\r\n<p>    How this strategy can be implemented and how to help your <em>brand </em>\"stick\" with customers. You need to add a story to customers or prospective buyers that your <em>brand </em>is essential to their lives to build <em>brand </em>awareness for them and become their loyal customers. One of the strengths of <em>brand immersion </em>is to have the customer a part of the story.     <em> </em>  <em> </em> </p>\r\n\r\n<p>    You need to be able to take advantage of digital platforms and every touchpoint that consumers face. This strategy teaches you to create products and <em>brand </em>packaging with deep traits to stay relevant to your rotating customers and encourages them to create their own story with your <em>brand</em>.  <em> </em> </p>\r\n\r\n<p><em>    Brand immersion </em>explains how to assemble <em>a brand </em>or company so that marketing, <em>advertising</em>, and public relations work holistically to convey the brand&#39;s message<em> </em>the same on various digital platforms. So far, the marketing strategy has always discussed products and increased sales to generate high profits.<em> </em> <em> </em>   </p>\r\n\r\n<p>    With this <em>branding </em>strategy, you are advised to think outside the box. You are advised to take the time to build relationships with customers, that is, involve or aim to sell your product or service. Let them know that you care about them, not digging into their personal information, and really care about them.  </p>\r\n\r\n<p>    So this strategy is possible to build a sense of care that is originally woven from a <em>brand</em>. Not always <em>marketing strategies, </em>even digital marketing, keep you from not caring about customers. You can ask our help from mamakriau.com  <a href=\"https://mamakriau.com/contact\">contact</a> to plan your marketing strategy through <em>brand immersion</em>.</p>\r\n\r\n<p> </p>\r\n\r\n<p> </p>\r\n\r\n<p> </p>\r\n\r\n<p> </p>\r\n', 'news', 'brand-immersion-value-in-marketing-strategy-20210217100246.jpg'),
(5, 3, 'brand-loyalty', 'Prio Kus Nugroho', 'Brand Loyalty', '<p><strong><a href=\"https://mamakriau.com/\">mamakriau.com</a> <em>- \" A strong brand loyalty will produce a strong brand .\"</em></strong>When building a brand, there are several stages that you will go through. Starting from spreading awareness of your brand to loyal customers. When your <em>brand </em>starts to stand, <em>brand </em>awareness is the main key to developing a <em>brand</em>. The more people who know and realize that your <em>brand </em>exists, the greater the opportunity for your <em>brand </em>to develop. After your brand grows, the next important step for you to take is to increase <em>brand loyalty</em>. <em>Brand loyalty </em>measures how loyal and loyal your customers are to the <em>brand, t</em>hen the greater the opportunity to <em>brand would survive</em>. <em>  </em>   <em> </em> <em> </em> </p>\r\n\r\n<div><strong>Also Read: The Importance of Personal Branding for Millennials </strong></div>\r\n\r\n<div><strong>Brand Loyalty Function for Brands</strong></div>\r\n\r\n<p>Having high <em>brand loyalty </em>means having consumers with a high level of loyalty. In other words, consumers will always choose the <em>brand </em>you over the other <em>brand</em>. Here is the <em>brand loyalty </em>function for your <em>brand</em>. <em> </em>  <em> </em> <em> </em> <em> </em>  <em> </em> </p>\r\n\r\n<div><strong>1. Reducing Marketing Costs</strong></div>\r\n\r\n<p>If you have great <em>brand loyalty</em>, it will affect the marketing costs incurred. Marketing costs incurred to retain customers will be cheaper than having to find new customers. This is because you already have customer data and know which media can effectively reach your customers. <em> </em>  </p>\r\n\r\n<div><strong>2. Increase Sales</strong></div>\r\n\r\n<p>If consumers have high loyalty to a <em>brand</em>, then these consumers will buy the brand&#39;s products or services. Not only that, if your <em>brand </em>releases a new product, customers will also be interested in trying it, so it will indirectly increase your company&#39;s sales.  <em> </em> </p>\r\n\r\n<div><strong>3. Attract New Customers</strong></div>\r\n\r\n<p>If a customer feels satisfied and believes in a <em>brand</em>, then that customer will use it continuously. After feeling satisfied with the product, customers will usually recommend the products used to their family and their closest ones to use the same product. Loyal customers will become your <em>brand </em>advocates and attract new customers to your <em>brand</em>.  </p>\r\n\r\n<div><strong>4. Give time to respond to competitors&#39; threats</strong></div>\r\n\r\n<p><em>Brand loyalty </em>will give the company time and opportunity to respond to competitors&#39; threats. If other competitors issue new products, loyal customers will give the company time to develop the resulting product by adjusting or innovating to be able to compete with competitors&#39; new products. </p>\r\n\r\n<p>By explaining the function of <em>brand loyalty </em>above, it can be concluded that <em>brand loyalty </em>is the key to the success of a <em>brand</em>. The higher the level of <em>brand loyalty for </em>a <em>brand</em>, the stronger the <em>brand will </em>survive. <em> </em> <em>  </em>   <em> </em>   <em> </em> </p>\r\n\r\n<p> </p>\r\n\r\n<p>If you need consultation and assistance in developing your <em>brand loyalty</em>, visit us <a href=\"https://mamakriau.com/contact\" target=\"_blank\">here.</a> <em> </em>  </p>\r\n\r\n<p> </p>\r\n\r\n<p> </p>\r\n', 'team', 'brand-loyalty-20210217100224.jpg'),
(6, 3, 'can-help-increase-business', 'Prio Kus Nugroho', 'Did you know that using a branding agency can help increase business?', '<p>    <a href=\"https://mamakriau.com/\">mamakriau.com</a> - Increasingly tight competition in the business world has made many companies use <strong>branding agencies </strong>or digital agencies. Why is that? The steps taken by business people in using branding services are certainly not without reason. Check out detailed information about these digital marketing services below. <strong>  </strong></p>\r\n\r\n<div><strong>What Is a Branding Agency?</strong></div>\r\n\r\n<p>A digital agency is defined as an agency, or a service company that serves to brand is online. This branding process includes activities to create, develop, maintain, and also increase <em>brand awareness</em>. This one service will also work on the design and communication process to the audience. </p>\r\n\r\n<p>However, the main focus of this <strong>branding agency </strong>service is to carry out a <em>branding strategy so</em> that they try their best to ensure that the brand that is being worked on is known more widely by the public. As well as sticking in people&#39;s memories about the advantages or attractiveness of the brand itself. <strong>  </strong> </p>\r\n\r\n<p>Services branding will maximize marketing activities brand digitally or online through a variety of media. When done by professionals, it is expected that the results will be more satisfying than being done alone. So it is not wrong if the service user company needs to choose carefully not to be disappointed.</p>\r\n\r\n<div><strong>Tips for Choosing the Best Branding Agency</strong></div>\r\n\r\n<p>If you plan to use a <strong>branding agency, </strong>then consider the details of important things that need to be considered when choosing. Among them are: <strong>  </strong></p>\r\n\r\n<div><strong>1. Marketing Tools Used</strong></div>\r\n\r\n<p>A digital branding service is guaranteed to use one or more <a href=\"https://translate.google.com/translate?hl=id&prev=_t&sl=id&tl=en&u=https://www.niagahoster.co.id/blog/marketing-tools/\" target=\"_blank\"><em>tools</em></a> to maximize the performance of its team. <em>These tools </em>or tools are of various types, and there should be transparency. Namely, informing the types of <em>tools </em>used to ensure the performance of these <em>tools </em>according to company needs. <a href=\"https://translate.google.com/translate?hl=id&prev=_t&sl=id&tl=en&u=https://www.niagahoster.co.id/blog/marketing-tools/\" target=\"_blank\"><em> </em></a> <em> </em> <em> </em> <em> </em></p>\r\n\r\n<p>In addition, you as the client can ensure that these services do not use <em>tools </em>that are detrimental to the company because some <em>tools </em>will be detected as machines with some risks. As a result, Google, for example, will be considered <em>spam, </em>and the company&#39;s website will be <em>banned</em>. <em> </em> <em> </em> <em> </em> </p>\r\n\r\n<div><strong>2. Variations of Services Provided</strong></div>\r\n\r\n<p>It&#39;s good to find a digital branding agency that provides a variety of services. So that helps to brand through social media and websites and other strategic media on the internet. The more varied the services provided, the more optimal the branding affects their team will do so that the company will be more profitable.</p>\r\n\r\n<div><strong>3. Portfolio</strong></div>\r\n\r\n<p>The next tip for getting the best digital branding agency is to look at the portfolio. Make sure to check what their team has worked on and testimonials from previous clients. To be more sure, don&#39;t just ask for a testimonial <em>screenshot</em>. Instead, ask for their explanation of the projects. <em> </em></p>\r\n\r\n<div><strong>4. Provide Routine Reports</strong></div>\r\n\r\n<p>Event branding online that uses many strategies and tools would sometimes become problematic. The existence of this kind of error is common, which indicates the process is carried out safely. However, make sure the <strong>branding agency </strong>chosen by the discipline provides reports, especially work results and errors during the branding strategy. <strong>  </strong></p>\r\n\r\n<div><strong>5. Quality of Service</strong></div>\r\n\r\n<p>Your interactions with these branding service providers also need to be considered carefully. Make sure you understand each other and are on the same frequency so that there is no misunderstanding along the way. Also, prioritize those with friendly service so that you are comfortable interacting with their team.</p>\r\n\r\n<div><strong>6. Adjusting to the Budget</strong></div>\r\n\r\n<p>It would be safer to choose an online branding service whose service costs are within the budget. There is no need to impose a budget because there are many agencies to choose from. If you are lucky, you can get services at standard prices, but the quality of work is maximum.</p>\r\n\r\n<p>The choice of a <strong>branding agency </strong>service cannot be arbitrary because it will determine its future. So, please pay attention to the important things above to get disappointed or regret it later. <strong>  </strong></p>\r\n\r\n<p>Want to know more information about the world of branding? Visit the mamakriau.com website <a href=\"https://mamakriau.com/\" target=\"_blank\">here. </a>You can also contact us if you need an agency that specializes in branding <a href=\"https://mamakriau.com/contact\" target=\"_blank\">here</a>.    </p>\r\n\r\n<p> </p>\r\n\r\n<p> </p>\r\n', 'gallery', 'did-you-know-that-using-a-branding-agency-can-help-increase-business-20210217100724.jpg');
INSERT INTO `book` (`id`, `id_kategori`, `slug`, `writer`, `title`, `description`, `alt`, `image`) VALUES
(10, 3, 'awareness-engagement-before-becoming-profitable', 'Prio Kus Nugroho', 'Don\'t Underestimate, This Is The Importance Of Awareness & Engagement Before Becoming Profitable', '<p>    <a href=\"https://mamakriau.com/\">mamakriau.com</a> - Digital innovation seems to be a storm that comes without stopping. Not satisfied with using one social media, other social media have appeared. Not to <em>seal </em>play game one, it appears more games other better. It feels like being hypnotized to keep holding a <em>smartphone </em>or computer.</p>\r\n\r\n<p>But that&#39;s not all that surprising. What really amazes us is when all these digital innovations have succeeded in \"hypnotizing\" us to make mistakes, aka spending money continuously. They use the same method to make profits starting from e-commerce, marketplaces, social media, games, and digital comics.</p>\r\n\r\n<p>Countless miles queen friends are victims of the current viciousness of digital promotion trends. Let us for a moment respect the collapsed wallets of the victims, including your wallets. * take the hat off * lower head</p>\r\n\r\n<p>Okay, seriously.</p>\r\n\r\n<p>From a consumer perspective, digital innovation has indeed made us more wasteful. However, from an entrepreneur&#39;s perspective, digital innovation has the potential to reap much greater profits. No doubt, many Indonesians are starting to take advantage of this opportunity.</p>\r\n\r\n<p>The problem is that only by seeing the success of digital entrepreneurs abroad, many local players skip product/service maturation processes. So, it seems like he is underestimating the digital world, which is full of obstacles. An example is like assuming that Facebook Ads or Google Ads <strong>will definitely </strong>bring you profits automatically.</p>\r\n\r\n<p>This is too trivial.</p>\r\n\r\n<p>Therefore, digital entrepreneurs or startups need to understand the concept of digital marketing. <strong>Don&#39;t rush to make a profit in the digital \"ocean\" if the \"swimming\" isn&#39;t smooth yet. </strong>Turtles ... uh ... something like that.</p>\r\n\r\n<p>So, what do we need to know if we want to be successful entrepreneurs in the digital world (whether e-commerce, <em>software developers</em>, games, comics)? Come on, sit tight, pay attention to the lecture of Ibu Guru Seruni!</p>\r\n\r\n<p> </p>\r\n\r\n<div><strong>1. Profits do not happen suddenly. There is a process!</strong></div>\r\n\r\n<p>Let&#39;s look at an example in the field.</p>\r\n\r\n<p>We learn from the Go-Jek and Tokopedia course. Let it be contemporary. Do companies as big as Amazon and Tokopedia immediately benefit from starting a business? Of course not.</p>\r\n\r\n<p>As released by <a href=\"https://translate.google.com/translate?hl=id&prev=_t&sl=id&tl=en&u=https://kumparan.com/@kumparanbisnis/go-jek-belum-untung-bisa-ipo-berikut-aturan-lengkapnya\" target=\"_blank\">Kumparan</a>, Go- Jek itself hasn&#39;t even made a profit. The financial record is still minus. <a href=\"https://translate.google.com/translate?hl=id&prev=_t&sl=id&tl=en&u=https://katadata.co.id/berita/2018/08/27/tunda-ipo-tokopedia-dan-bukalapak-fokus-perluas-pasar\" target=\"_blank\">Tokopedia can also be said to have followed the same path</a>; the money is still being circulated, although it is not stated how many minutes.</p>\r\n\r\n<p>We see Go- Jek and Tokopedia as big companies, but why don&#39;t they profit yet? <strong>Because it&#39;s not the time yet</strong>. Currently, they are focused on the <strong>process of </strong>getting a profit, but they don&#39;t want to make a profit yet. Most of their money still comes from investors, not from profits.</p>\r\n\r\n<p>They need to \"show off\" and \"woo\" the prospect to make a profit. Well, that is what Go- Jek and Tokopedia are doing. Just look at the discounts offered by Go- Jek, for example. Isn&#39;t it tempting? It is an example that Goes- Jek is \"seducing\" us to use his services.</p>\r\n\r\n<p>Later, when customers are comfortable doing business with Go- Jek or Tokopedia, the two companies will make a profit.</p>\r\n\r\n<p>This shows that profit cannot be obtained instantly but <a href=\"https://translate.google.com/translate?hl=id&prev=_t&sl=id&tl=en&u=https://2012books.lardbucket.org/books/powerful-selling/s10-01-it-s-a-process-seven-steps-to-.html\" target=\"_blank\">must go through several processes</a> that are not short.</p>\r\n\r\n<p> </p>\r\n\r\n<div><strong>2. Know <em>awareness </em>and <em>engagement</em>, two important things, before making money</strong></div>\r\n\r\n<p>In the world of digital marketing, sales are often referred to as <em>closing </em>or conversions. To reach this conversion level, we need to strengthen the two foundations first, namely awareness<em> </em>and <em>engagement</em>.</p>\r\n\r\n<p><em>Awareness </em>means increasing people&#39;s awareness of a product or brand, while <em>engagement </em>means increasing people&#39;s interaction with the product or brand.</p>\r\n\r\n<p>\" <em>Wait a minute, I&#39;m still dizzy, ya. That </em>awareness <em>and </em>engagement <em>are like how, anyway? </em>\"</p>\r\n\r\n<p>Okay, we explain one by one, yes.</p>\r\n\r\n<p><em>Awareness </em>means all efforts to make potential customers remember what the company has to offer. In addition, <em>awareness </em>also enables potential customers to differentiate between companies (if they sell similar products/services). At this stage, the company introduces its identity to prospective customers, so you can also see the advantages and disadvantages of a company.</p>\r\n\r\n<p>As explained by the <a href=\"https://translate.google.com/translate?hl=id&prev=_t&sl=id&tl=en&u=https://trackmaven.com/marketing-dictionary/brand-awareness/\" target=\"_blank\">TrackMaven</a> website, this <em>awareness </em>is an effort to convey the company&#39;s message to potential customers. It is easy to remember and easy to distinguish from other brands. <em>Awareness is </em>good for new companies that are trying to introduce their services or products to candidates. Customer.</p>\r\n\r\n<p>Simple illustration of an awareness activity: \"screaming\" at a potential customer to be interested in you</p>\r\n\r\n<p>Then there&#39;s <em>engagement. </em>This is an attempt to make potential customers interact with the <em>brands </em>we carry. This process usually occurs after the prospect&#39;s <em>awareness </em>or <em>awareness </em>is strong. At this stage, will the company begin to introduce its products or company values? In more detail and interest, so that potential customers will begin to consider buying the product.</p>\r\n\r\n<p>According to <a href=\"https://translate.google.com/translate?hl=id&prev=_t&sl=id&tl=en&u=https://www.forbes.com/sites/robertpassikoff/2013/06/17/defining-brand-engagement/#65bf761e4446#65bf761e4446\" target=\"_blank\">Forbes</a>, good <em>engagement </em>is when it can engage the emotions of a potential customer so that they feel closer to the <em>brand</em>. When that happens, potential customers will also see the positive side of the <em>brand, </em>which is much more intimate. And this is an important stage before they finally decide to buy a product.</p>\r\n\r\n<p>In short, <em>awareness </em>and <em>engagement </em>are the closing processes for potential customers. I see, bro.</p>\r\n\r\n<p>So, if we look at the definition and concept, <em>awareness </em>and <em>engagement </em>cannot be overlooked because both are introductions to conversion. The principle is quite simple: <strong>people will not suddenly want to buy a product if they don&#39;t know it. </strong>Even women don&#39;t buy vegetables at any vegetable seller.</p>\r\n\r\n<p>In the world of marketing, this entire process is often called a <em>conversion funnel. </em>It is usually depicted in a funnel-like chart to explain that conversion is not something that happens suddenly but several processes behind it. The terms per process can vary, but the concept remains the same.</p>\r\n\r\n<p>Image source: venturecreations.com</p>\r\n\r\n<div><strong>3. <em>Content is the king</em></strong></div>\r\n\r\n<p>There are many ways we can increase <em>awareness </em>and <em>engagement </em>before a sale occurs. Creating interesting content is one way.</p>\r\n\r\n<p>In today&#39;s digital era, content is king. The more interesting and unique the content we create, the more likely it is to be <em>engaged </em>by the audience. As we explained earlier, being able to capture interactions means getting closer to the sales process.</p>\r\n\r\n<p>We&#39;ll see just an example.</p>\r\n\r\n<p>DelfiOrion Chocopie, a chocolate pie brand from Korea, uses cute and challenging cartoon content to increase audience interaction. This is one of the most visited contents of his audience (1200 likes, 300 comments):</p>\r\n\r\n<p>Or, we can also reflect on the content delivered by Hexos. Like DelfiOrion Chocopie, this legendary candy brand uses content unique to high school students to increase the interaction of potential customers with Hexos candy.</p>\r\n\r\n<p>For example, Hexos create the characters Exel who had a habit synonymous with children <em>ages now</em>. Exel will appear in every Hexos content and invite high school students to interact and feel intimate. The following is one of the most visited content with Exel characters (2000 likes, 200 comments):</p>\r\n\r\n<p>Content has proven to be king for <em>brands</em>, especially those that play a lot in the realm of social media. This is then referred to as <em>content marketing, </em>namely content that can increase interaction to drive sales.</p>\r\n\r\n<p>The <a href=\"https://translate.google.com/translate?hl=id&prev=_t&sl=id&tl=en&u=https://contentmarketinginstitute.com/2017/05/create-high-converting-content/\" target=\"_blank\">Content Marketing Institute website </a>itself says that content is the basis of conversion, and every <em>content marketer </em>should think about what content can increase product sales.</p>\r\n\r\n<div><br>\r\n<strong>4. <em>Advertising: </em>strategies to help spread content</strong></div>\r\n\r\n<p> Creating content is sometimes not enough; we also need to promote it to be seen by many people. One of the ultimate ways we can do business owners is by <em>advertising </em>or commonly abbreviated as <em>ads</em>.</p>\r\n\r\n<p>Two mainstay ads platforms are commonly used by marketing people in the digital world, namely Facebook Ads and Google Ads. These two platforms have been proven to bring many benefits for business owners, no wonder it is widely used by several big brands such as Go- Jek, Shopee, Tokopedia, and LINE.</p>\r\n\r\n<p>If you like blog walking<em> </em>or <em>scrolling through </em>Facebook news feeds, or looking at IG Stories, you&#39;ve definitely seen advertisements from some of the companies above.</p>\r\n\r\n<p>With <em>ads, </em>we can spread content with a much wider reach. If usually we only get 100 <em>likes </em>on social media with regular posts, with <em>ads, </em>we can multiply it to thousands or even hundreds of thousands of <em>likes</em>. Something like that.</p>\r\n\r\n<div><strong>\" <em>Then, how do ads work? </em>\"</strong></div>\r\n\r\n<p>Pay attention when the <em>ads </em>stage has reached \"ON 1,000 OF WEBSITES\". At that stage, our content will be widely distributed. That means <em>ads </em>also have the potential to increase <em>awareness </em>and new <em>engagement </em>figures from new potential customers.</p>\r\n\r\n<p>No wonder large companies are willing to spend their money to place ads or <em>ads </em>on almost all platforms. Because from there, they are also flooded with potential new customers with lower costs and <em>effort</em>. What&#39;s not great about trying these <em>ads</em>?</p>\r\n\r\n<p>Besides ads, there are also several other strategies to increase <em>awareness </em>and <em>engagement, </em>such as activation, <em>buzzing, tracking, </em>and <em>clickbait! </em>Well, you know! Isn&#39;t that interesting? However, we will keep these discussions in more detail in the next lecture. What is clear, friends already understand enough about the importance of <em>awareness </em>and <em>engagement, </em>right?</p>\r\n\r\n<div><strong>Conclusion</strong></div>\r\n\r\n<p>After going through the various explanations above, what lessons can we take from mamakriau&#39;s lecture today?</p>\r\n\r\n<p><strong>First, </strong>mistakes are commonplace (this justifies <em>action figure </em>buyers and ladies who buy cute negligees). <strong>Second, </strong>there are no outright sales. <strong>Third, </strong>before conversion (sales) occurs, we need to strengthen <em>awareness </em>and <em>engagement </em>first.</p>\r\n\r\n<p><strong>Fourth, </strong>this is the most important. If friends have a business and find it difficult to increase <em>awareness</em>, <em>engagement</em>, or even conversions, don&#39;t hesitate to contact or consult us. Seruni Creative is here to help! We have experience creating cool content for several well-known <em>brands </em>and increasing their sales even better.</p>\r\n\r\n<p>If friends need our help, please send an e-mail to <a href=\"mailto:hello@serunicreative.com\" target=\"_blank\">r</a><a href=\"https://mamakriau.com/contact\">iau_mariana@mamakriau.com</a>. Let&#39;s work together!</p>\r\n\r\n<p> </p>\r\n', 'mentoring', 'dont-underestimate-this-is-the-importance-of-awareness-engagement-before-becoming-profitable-20210218110734.jpg'),
(8, 3, 'examples-of-good-branding-strategies', 'Prio Kus Nugroho', 'Examples of Good Branding Strategies', '<p>    <a href=\"https://mamakriau.com/\">mamakriau.com</a> - All big <em>brands </em>start small; it&#39;s time you started. Prepare a good strategy and build the identity of your <em>brand </em>to compete in a competitive market.    </p>\r\n\r\n<p><em>Branding </em>strategy is defined as an attempt to introduce business values ?? to consumers. This is manifested in several aspects, such as names, logos, brands, taglines, slogans, and special colors. In essence, a branding strategy seeks to convey the uniqueness of a business to its target market.  </p>\r\n\r\n<p>In achieving this goal, each business actor, of course, has his own formula. So, how do you know if a branding strategy is well formulated or not? Here&#39;s the explanation.</p>\r\n\r\n<p>Examples of Good <em>Branding </em>Strategies  </p>\r\n\r\n<p><em>What&#39;s your brand? </em>This question is one example of a successful branding strategy. We often hear Indonesians think of Honda as the name for a motorcycle when it is a brand. So, what are the benchmarks for a good <a href=\"https://mamakriau.com/project/category/strategic-brand-solution\" target=\"_blank Rel=nofollow\"><em>branding</em></a> strategy?<em>  </em> <a href=\"https://translate.google.com/translate?hl=id&prev=_t&sl=id&tl=en&u=https://www.niagahoster.co.id/blog/apa-itu-branding-dan-strategi-branding/\" target=\"_blank Rel=nofollow\"> </a></p>\r\n\r\n<div><strong>1. A memorable logo</strong></div>\r\n\r\n<p>Mentioning one of the world&#39;s sports brands, Nike, must be familiar to your ears. Nike is one of the market leaders whose prestige is commonly known by the world community. One of the most distinctive features of this brand is its logo which looks like a checkmark.</p>\r\n\r\n<p>Amazingly, this logo turns out to be so easy to remember and stick with the brand. You can recognize Nike products by looking at the logo without having to read the full brand name. Counterfeit products often use even the Nike logo. However, even from the pun, you can already tell what brand is being copied.</p>\r\n\r\n<p>Learning from Nike, create a branding strategy by creating a unique logo, simple but easy to recognize.</p>\r\n\r\n<div><strong>2. Insert the value in the product</strong></div>\r\n\r\n<p>The second lesson comes from an example of Hermes&#39; branding strategy. This brand has a good strategy by inserting an exclusive value into each of its products. Until now, Hermes is not only seen as a bag but reflects many things.</p>\r\n\r\n<p>Starting from the user&#39;s economic status, prestige, the price range is above average and the ingredients&#39; quality on an international scale. This example of the Hermes branding strategy reflects a good branding pattern to bring out the uniqueness of the product in the market.</p>\r\n\r\n<p>Evidently, no matter what form, as long as own brand Hermes certainly people spontaneously think about exclusivity and how <em>high class </em>of his products. </p>\r\n\r\n<div><strong>3. Be innovative</strong></div>\r\n\r\n<p>Apart from Honda, another product in Indonesia has a strong branding strategy, namely Softex. Until now, many people still use the Softex brand as a substitute for the word sanitary napkin.</p>\r\n\r\n<p>For example, want to buy Softex brand Charm or need the Softex brand Laurier. Though both are competitor brands. However, because Softex has good branding, its brand rings a bell and is used as a general designation for various products.</p>\r\n\r\n<p>The branding lesson learned from Softex is that being the first product originator will give you massive benefits to strengthen your branding strategy. Of course, this strategy requires maximum creativity and innovation.</p>\r\n\r\n<div><strong>4. Take advantage of the PR Campaign </strong></div>\r\n\r\n<p>Have you ever bought a Pepsodent product because it aims to donate rice boxes for those in need? Or have you ever chosen the Ades mineral water brand to contribute to recycling plastic waste?</p>\r\n\r\n<p>The two above are examples of <em>PR campaigns</em>, namely campaigns aimed at inserting special values ?? into their products. Here, the campaign is not only aimed at engaging consumers but also wants to build meaningful attachments. </p>\r\n\r\n<p>So that a brand is remembered as an empty product and has goals and motivations that are in line with consumers.</p>\r\n\r\n<p>Those are some examples of good branding strategies, which you can try and modify according to business needs.  </p>\r\n\r\n<p>Do you want to start <em>branding </em>your business? Please leave it to the professionals at <a href=\"https://mamakriau.com/\">mamakriau.com</a>, who are always ready to help you create interesting strategies. Contact us <a href=\"https://mamakriau.com/contact\">here</a>. <em> </em> </p>\r\n\r\n<p> </p>\r\n\r\n<p> </p>\r\n', 'meeting', 'examples-of-good-branding-strategies-20210217103535.jpg');
