INSERT INTO `detail` (`id`, `slug`, `title`, `description`, `image`) VALUES
(1, 'cinelight-photography', 'Cinelight Photography (Piatra Neamt, Romania, EU)', 'Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat. Duis aute irure dolor in reprehenderit in voluptate velit esse cillum dolore eu fugiat nulla pariatur. Excepteur sint occaecat cupidatat non proident, sunt in culpa qui officia deserunt mollit anim id est laborum.', 'cinelight-photography-piatra-neamt-romania-eu-20210211055518.png'),
(2, 'angeles-contables', 'Angeles Contables', 'Small businesses in Puerto Rico with accounting bookkeeping services to help business owners comply with tax and other financial requirements. This service, aided by our technology platform, aims at alleviating a task that is considered to be tedious, intimidating, time-consuming, manual (paper-based), and in many cases, not a priority for business owners. This startup hopes to accelerate the path towards prosperity sought by so many on the island, and we hope to position it as a private but social (mission-driven) enterprise. Ángeles Contables is a translation of Accounting Angels. Much of the time, our clientele feels anxious towards the financial aspect of their company because of its complexity or because of their lack of knowledge in the topic. Our goal is to inspire friendliness and simplicity in our brand to feel at ease and relieve knowing that their finance is in the hand of experts and out of their to-do list. We are also aiming to offer competitive prices and employee recent college grads looking to build experience in the accounting field.', 'angeles-contables-20210228101219.jpg'),
(3, 'waste-medic', 'Waste Medic', 'Waste Medic provides the transportation, treatment, and disposal of your medical waste by all current regulations. We are proud to offer unparalleled customer service to our clients with years of expertise in medical waste solutions across all disciplines while also being mindful of the effects on the environment and people. Specialties include Medical Waste Disposal, OSHA Safety Plans, Sharps Disposal, Online Compliance Portal, HIPPA Training, and Bloodborne Pathogen Training.', 'waste-medic-20210228100730.png'),
(4, 'affiliate-incubator', 'The Affiliate Incubator', 'We are launching a course to train aspiring affiliate managers. The target audience is young professionals.', 'the-affiliate-incubator-20210228101353.png'),
(5, 'evos-gg', 'www.evos.gg (Jakarta, Indonesia)', 'This website was built aimed at the Company Profile and more detailed information on Evos Esports, starting from tournament schedules, member registration, and many other features. This website was built using the PHP programming language for technology using the Laravel framework.', 'wwwevosgg-jakarta-indonesia-20210910141107.jpg'),
(6, 'foro-appio', 'Foro Appio Mansion Hotel (SS7, 04100 Borgo Faiti LT, Italia)', 'This website was built for information and reservations for the hotel branch of HotelNerds, namely Foro Appio Mansio Hotel. This website was built using the PHP programming language and for technology using the Yii framework.', 'foro-appio-mansion-hotel-ss7-04100-borgo-faiti-lt-italia-20210228101541.jpg'),
(7, 'indonesiatrip-id', 'indonesiatrip.id (Jakarta, Indonesia)', 'This website was built for E-Commerce and also information about tours & travel, from costs to estimated travel time. This company originates from Lombok, West Nusa Tenggara. This website is built using the WordPress Content Management System.', 'indonesiatripid-20210207094118.jpg'),
(8, 'javtore', 'Javtore (Bekasi, Indonesia)', 'A professional website design with an optimized layout and information, reflecting the current business and company you are running. Customers will give a special appreciation for a professional website. At Javtore, you will find a website created by a team of experienced and professional experts.', 'javtore-20210207012918.png'),
(9, 'cocove', 'cocove (Riyadh, Saudi Arabia)', 'Provides quality chocolate treats.', 'cocove-20210208020415.jpg'),
(10, 'exquisite-moon', 'Exquisite moon', 'A high-end clothing boutique for women, men, and gender fluid! Also, be offering a subscription styling service. Client hoping to find a sophisticated and luxurious logo! All size-inclusive, online boutiques for women, men, and gender-fluid will also offer a subscription styling service.', 'exquisite-moon-20210228101946.jpg'),
(11, 'tecumsehs-book-ranch', 'Tecumseh\'s Book Ranch', 'Tecumseh\'s Book Ranch (Tecumseh\'s or the Book Ranch) is a local bookstore offering a curated selection of general interest fiction and non-fiction books for the Fulshear-Katy book-loving community. Our customers view books as an important part of their lives and the lives of their families. They see reading and books as a part of a community and enjoy feeling like they are part of a community in which they can share their book discoveries. They expect to find more than bestsellers at Tecumseh’s and trust it to provide entree? To books that are identified by their fellow community members and not corporate headquarters. Although they may occasionally be looking for a specific title, they truly enjoy being able to leisurely walk the stacks hoping to find the title they didn’t know they wanted. Although we take books seriously and enjoy serious books, we are not stuffy; we are Texans, after all!', 'tecumsehs-book-ranch-20210910140513.jpg'),
(12, 'phoenix-solarpanelsystem', 'Phoenix Solar Panel System', 'Phoenix Solar Panel Systems is built on the principles of professionalism, transparency, honesty, and fairness. We provide our customers with the best solutions, with the highest quality products, at an affordable price. At Phoenix Solar Panel Systems, we are in the people business, not the solar business. Customer service is our highest priority, and we go above and beyond to ensure that we exceed our customers’ expectations on every project we do!', 'phoenix-solar-panel-system-20210228102413.png');
