INSERT INTO `product` (`id`, `id_category`, `id_detail`, `id_mockup`, `slug`, `title`, `description`, `client`, `url`, `date`, `writer`, `is_available`, `image`) VALUES
(84, 11, 1, 1, 'cinelight-photography', 'Cinelight Photography', 'Cinelight is a European seller of professional lighting equipment for the photo, video, and film industries. All products are manufactured under the Cinelight brand, and we do not sell generic or other brands products. The main goal is to supply reliable equipment with up-to-date designs and features. We try to make a difference in the market by constantly improving our products and developing new ones closely following our customer\'s feedback. In terms of brand identity, we aim for the technical approach as we mostly address the pro-summers and professionals in the industry. The primary target audience is 25 to 45 years old males who work in the photo, video, and film industries.', 'Cinelight Photography (Piatra Neamt, Romania, EU)', 'https://cinelight.com/', 'August 26th, 2020', 'Erwa Setianingsih', 1, 'cinelight-photography-20210207080719.png'),
(85, 11, 2, 2, 'angeles-contables', 'Angeles Contables', 'Small businesses in Puerto Rico with accounting bookkeeping services to help business owners comply with tax and other financial requirements. This service, aided by our technology platform, aims at alleviating a task that is considered to be tedious, intimidating, time-consuming, manual (paper-based), and in many cases, not a priority for business owners. This startup hopes to accelerate the path towards prosperity sought by so many on the island, and we hope to position it as a private but social (mission-driven) enterprise. Ángeles Contables is a translation of Accounting Angels. Much of the time, our clientele feels anxious towards the financial aspect of their company because of its complexity or because of their lack of knowledge in the topic. Our goal is to inspire friendliness and simplicity in our brand to feel at ease and relieve knowing that their finance is in the hand of experts and out of their to-do list. We are also aiming to offer competitive prices and employee recent college grads looking to build experience in the accounting field.', 'Angeles Constables', '', 'Sept 16th, 2020', 'Erwa Setianingsih', 1, 'angeles-contables-20210228093820.png'),
(87, 11, 3, 3, 'waste-medic', 'Waste Medic', 'Waste Medic provides the transportation, treatment, and disposal of your medical waste by all current regulations. We are proud to offer unparalleled customer service to our clients with years of expertise in medical waste solutions across all disciplines while also being mindful of the effects on the environment and people. Specialties include Medical Waste Disposal, OSHA Safety Plans, Sharps Disposal, Online Compliance Portal, HIPPA Training, and Bloodborne Pathogen Training.', 'Waste Medic', '', 'July 20th, 2020', 'Erwa Setianingsih', 1, 'waste-medic-20210228093901.png'),
(88, 11, 4, 4, 'affiliate-incubator', 'The Affiliate Incubator', 'We are launching a course to train aspiring affiliate managers. The target audience is young professionals.', 'The Affiliate Incubator', 'https://courses.theaffiliateincubator.com/', 'Sept 4th, 2020', 'Erwa Setianingsih', 1, 'the-affiliate-incubator-20210228093746.png'),
(89, 12, 5, 5, 'www-evos-gg', 'www.evos.gg', 'This website was built aimed at the Company Profile and more detailed information on Evos Esports, starting from tournament schedules, member registration, and many other features. This website was built using the PHP programming language for technology using the Laravel framework.', 'www.evos.gg (Jakarta, Indonesia)', 'https://www.evos.gg/', 'Des 28th, 2020', 'Erwa Setianingsih', 1, 'wwwevosgg-20210206190134.png'),
(90, 12, 6, 6, 'foro-appio-mansion-hotel', 'Foro Appio Mansion Hotel', 'This website was built for information and reservations for the hotel branch of HotelNerds, namely Foro Appio Mansio Hotel. This website was built using the PHP programming language and for technology using the Yii framework.', 'Foro Appio Mansion Hotel (SS7, 04100 Borgo Faiti LT, Italia)', 'https://www.foroappiohotel.it/en/', 'May 3rd, 2020', 'Erwa Setianingsih', 1, 'foro-appio-mansion-hotel-20210206195828.png'),
(91, 12, 7, 7, 'indonesiatrip-id', 'indonesiatrip.id', 'This website was built for E-Commerce and also information about tours & travel, from costs to estimated travel time. This company originates from Lombok, West Nusa Tenggara. This website is built using the WordPress Content Management System.', 'Indonesia Trip (Jakarta, Indonesia)', 'https://indonesiatrip.id/', 'Des 21st, 2020', 'Erwa Setianingsih', 1, 'indonesitripid-20210206235542.png'),
(92, 12, 8, 8, 'javtore', 'Javtore', 'A professional website design with an optimized layout and information, reflecting the current business and company you are running. Customers will give a special appreciation for a professional website. At Javtore, you will find a website created by a team of experienced and professional experts.', 'Javtore (Bekasi, Indonesia)', 'https://javtore.com/', 'Des 18th, 2020', 'Erwa Setianingsih', 1, 'javtore-20210207041928.png'),
(93, 17, 9, 9, 'cocove', 'cocove', 'Provides quality chocolate treats.', 'cocove (Riyadh, Saudi Arabia)', '', 'Nov 23rd, 2020', 'Erwa Setianingsih', 1, 'cocove-20210226000358.png'),
(94, 17, 11, 10, 'tecumsehs-bookranch', 'Tecumseh\'s Book Ranch', 'Tecumseh\'s Book Ranch (Tecumseh\'s or the Book Ranch) is a local bookstore offering a curated selection of general interest fiction and non-fiction books for the Fulshear-Katy book-loving community. Our customers view books as an important part of their lives and the lives of their families. They see reading and books as a part of a community and enjoy feeling like they are part of a community in which they can share their book discoveries. They expect to find more than bestsellers at Tecumseh’s and trust it to provide entreé to books that are identified by their fellow community members and not corporate headquarters. Although they may occasionally be looking for a specific title, they truly enjoy being able to leisurely walk the stacks hoping to find the title they didn’t know they wanted. Although we take books seriously and enjoy serious books, we are not stuffy; we are Texans, after all!', 'Tecumseh\'s Book Ranch', '', 'August 16th, 2020', 'Erwa Setianingsih', 1, 'tecumsehs-book-ranch-20210228102531.png'),
(95, 17, 12, 11, 'phoenix-solarpanelsystem', 'Phoenix Solar Panel System', 'Phoenix Solar Panel Systems is built on the principles of professionalism, transparency, honesty, and fairness. We provide our customers with the best solutions, with the highest quality products, at an affordable price. At Phoenix Solar Panel Systems, we are in the people business, not the solar business. Customer service is our highest priority, and we go above and beyond to ensure that we exceed our customers’ expectations on every project we do!', 'Steven Smith', 'https://www.phoenixsolarpanelsystems.com/', 'Jan 8th, 2021', 'Erwa Setianingsih', 1, 'phoenix-solar-panel-system-20210228102442.png'),
(97, 17, 10, 12, 'exquisite-moon', 'Exquisite moon', 'A high-end clothing boutique for women, men, and gender fluid! Also, be offering a subscription styling service. Client hoping to find a sophisticated and luxurious logo! All size-inclusive, online boutiques for women, men, and gender-fluid will also offer a subscription styling service.', 'Exquisite Moon', '', 'July 6th, 2020', '', 1, 'exquisite-moon-20210211101055.png');
